const verifyrsa = require("../evaluation-utils/verifyrsa");
const web3helpers = require('../../web3helpers');

const m = web3helpers.readfile();
const s0 = "";
const s1 = "";
const s2 = "";
const s3 = "";
const s4 = "";

const s5 = "";
const s6 = "";
const s7 = "";
const s8 = "";
const s9 = "";


switch (parseInt(process.argv[2])) {
    case 1:
        one();
        break;
    case 2:
        two();
        break;
    case 3:
        three();
        break;
    case 4:
        four();
        break;
    case 5:
        five();
        break;
    case 6:
        six();
        break;
    case 7:
        seven();
        break;
    case 8:
        eight();
        break;
    case 9:
        nine();
        break;
    case 10:
        ten();
        break;
    default:
        console.log("Destination unknown");
}

function one() {
    const S = "0x"+s1;

    verifyrsa.measure(m, S)
}

function two() {
    const S = "0x"+s0+s1;

    verifyrsa.measure(m+m, S)
}

function three() {
    const S = "0x"+s0+s1+s2;
    verifyrsa.measure(m+m+m, S)
}

function four() {
    const S = "0x"+s0+s1+s2+s3;
    verifyrsa.measure(m+m+m+m, S)
}

function five() {
    const S = "0x"+s0+s1+s2+s3+s4;
    verifyrsa.measure(m+m+m+m+m, S)
}

function six() {
    const S = "0x"+s0+s1+s2+s3+s4+s5;
    verifyrsa.measure(m+m+m+m+m+m, S)
}

function seven() {
    const S = "0x"+s0+s1+s2+s3+s4+s5+s6;
    verifyrsa.measure(m+m+m+m+m+m+m, S)
}

function eight() {
    const S = "0x"+s0+s1+s2+s3+s4+s5+s6+s7;
    verifyrsa.measure(m+m+m+m+m+m+m+m, S)
}

function nine() {
    const S = "0x"+s0+s1+s2+s3+s4+s5+s6+s7+s8;
    verifyrsa.measure(m+m+m+m+m+m+m+m+m, S)
}

function ten() {
    const S = "0x"+s0+s1+s2+s3+s4+s5+s6+s7+s8+s9;
    verifyrsa.measure(m+m+m+m+m+m+m+m+m+m, S)
}
